pragma solidity ^0.8.0;


interface IERC721 {

    function claim(uint value)  external returns (uint balance);
    function safeTransferFrom(address from,address to,uint256 tokenId) external;

}
contract Bulkmint_final{

  function bulkmint(address _token, uint256[] memory _tokenId) public  
   {

      for (uint256 i = 0; i < _tokenId.length; i++) {
          IERC721(_token).claim(_tokenId[i]);
          IERC721(_token).safeTransferFrom(address(this),msg.sender,_tokenId[i]);
    }
    }
}
